export default class extends React.Component{
    state={
        x:[[0, 0, 0],
            [0, 0, 0],
            [0, 0, 0]]
    }

    render(){
        return(
            <>
                {this.state.x.map((e, i) => function(e){
                    e.map((e, i) )
                })}
            </>
        );
    }
}
